import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import About from "./components/About";
import Categorical from "./components/Categorical";
import GenderCrimes from "./components/GenderCrimes";
import GenderCrimesVsNonGenderCrimes from "./components/GenderCrimes";
import IncomeRelatedVariables from "./components/IncomeRelatedVariables";
import TimeSeries from "./components/TimeSeries";
function VizNavigation() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container>
      <Navbar.Brand href="/home">Home</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className='categorical'>
          <Nav.Link href="/categorical"></Nav.Link>
          </Nav>
          <Nav className='gender-crimes'>
          <Nav.Link href="/gender-violence">Gender-Related Crimes</Nav.Link>
          </Nav>
          <Nav className='gender-all-crimes'>
          <Nav.Link href="/gender-crime-against-crime-overall">Gender-Related Crimes</Nav.Link>
          </Nav>
          <Nav className='income'>
          <Nav.Link href="/income-and-crime">Gender-Related Crimes</Nav.Link>
          </Nav>
          <Nav className='tsa'>
          <Nav.Link href="/time-series-analysis">Gender-Related Crimes</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default VizNavigation;
